import { Button } from "@mui/material";

export const Upload = () => {
  return (
    <>
      <div>
        &nbsp;&nbsp;&nbsp; Select File &nbsp;&nbsp;&nbsp;
        <Button variant="contained" component="label">
          Choose File
          <input type="file" hidden onChange={(e) => this.handleFile(e)} />
        </Button>
        <Button variant="contained" component="label">
          Upload
          <input type="file" hidden />
        </Button>
      </div>
    </>
  );
};
